import { useEffect, useState } from 'react';
import './App.css';
import Home from './components/home';


function App() {
  const [todos,setTodos]=useState()

  useEffect(()=>{
    const url = 'https://jsonplaceholder.typicode.com/todos';

    fetch(url)
    .then((res)=> {
      return res.json()
    })
    .then((data)=> {
        // console.log(data)
        setTodos(data)
    })
  },[]);

  return (
    <Home todos={todos} />
  );
}

export default App;
